$(document).ready(function () {
  prestashop.blockcart = prestashop.blockcart || {};
  var showModal = prestashop.blockcart.showModal || function (modal) {};
  $(document).ready(function () {
      $(document).on("click", "#js-cart-close", function (e) {
          $("#blockcart, #mobile-cart-wrapper, #_mobile_blockcart-content, #_desktop_blockcart-content").removeClass("show");
          $("#header").trigger("click");
          e.stopPropagation();
      });
      $(document).on("click", "#blockcart-content", function (e) {
          e.stopPropagation();
      });
      prestashop.on("updateCart", function (event) {
          var refreshURL = $("#blockcart").data("refresh-url");
          var requestData = {};
          if (event && event.reason) {
              requestData = { id_product_attribute: event.reason.idProductAttribute, id_product: event.reason.idProduct, action: event.reason.linkAction };
          }
          $.post(refreshURL, requestData)
              .then(function (resp) {
                  if (event.reason && event.reason.linkPlace == "cart-preview") {
                      $("#blockcart").replaceWith($(resp.preview).addClass("show"));
                  } else {
                      $("#blockcart").replaceWith($(resp.preview));
                  }
                  $("#mobile-cart-products-count").text($(resp.preview).find(".cart-products-count-btn").first().text());
                  prestashop.emit("responsive updateAjax", { mobile: prestashop.responsive.mobile });
                  if (resp.modal) {
                      showModal(resp.modal);
                  }
              })
              .fail(function (resp) {
                  prestashop.emit("handleError", { eventType: "updateShoppingCart", resp: resp });
              });
      });
  });
});
